  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Arrowwood
  WMD, Chase Lake, Johnson Lake, and Halfway Lake NWR outlines Refuge accomplishments
  during the 1989 calendar year. The report begins by giving a brief introduction
  to the Refuge, as well as the climatic and habitat conditions and land acquisition
  program during the year. The construction and maintenance section discusses construction,
  maintenance, and wildfires. Habitat management is discussed; topics include wetlands,
  forests, croplands, grasslands, grazing, fire management, pest control, and water
  rights. Wildlife- including endangered and threatened species, migratory birds and
  mammals- is also covered. The interpretation and recreation section discusses information
  and interpretation, recreation, and enforcement. Cooperative programs, items of
  interest, and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
